PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "customers" (
"customer_id" INTEGER,
  "first_name" TEXT,
  "last_name" TEXT,
  "date_of_birth" TEXT,
  "gender" TEXT,
  "address" TEXT,
  "city" TEXT,
  "state" TEXT,
  "zip_code" INTEGER,
  "phone_number" TEXT,
  "email" TEXT,
  "nationality" TEXT,
  "id_type" TEXT,
  "id_number" TEXT,
  "registration_date" TEXT
);
CREATE TABLE IF NOT EXISTS "accounts" (
"account_id" INTEGER,
  "customer_id" INTEGER,
  "account_type" TEXT,
  "balance" REAL,
  "currency" TEXT,
  "opening_date" TEXT,
  "status" TEXT
);
CREATE TABLE IF NOT EXISTS "transactions" (
"transaction_id" INTEGER,
  "account_id" INTEGER,
  "transaction_type" TEXT,
  "amount" REAL,
  "transaction_date" TEXT,
  "description" TEXT,
  "status" TEXT,
  "recipient_account_id" REAL
);
CREATE TABLE IF NOT EXISTS "employees" (
"employee_id" INTEGER,
  "first_name" TEXT,
  "last_name" TEXT,
  "date_of_birth" TEXT,
  "gender" TEXT,
  "address" TEXT,
  "phone_number" TEXT,
  "email" TEXT,
  "position" TEXT,
  "department" TEXT,
  "hire_date" TEXT,
  "salary" REAL
);
CREATE TABLE IF NOT EXISTS "management" (
"manager_id" INTEGER,
  "employee_id" INTEGER,
  "title" TEXT,
  "start_date" TEXT,
  "end_date" TEXT
);
CREATE TABLE IF NOT EXISTS "branches" (
"branch_id" INTEGER,
  "branch_name" TEXT,
  "address" TEXT,
  "city" TEXT,
  "state" TEXT,
  "zip_code" INTEGER,
  "phone_number" TEXT
);
CREATE TABLE IF NOT EXISTS "loans" (
"loan_id" INTEGER,
  "customer_id" INTEGER,
  "loan_type" TEXT,
  "amount" REAL,
  "interest_rate" REAL,
  "term_months" INTEGER,
  "start_date" TEXT,
  "end_date" TEXT,
  "status" TEXT
);
CREATE TABLE IF NOT EXISTS "payments" (
"payment_id" INTEGER,
  "loan_id" INTEGER,
  "payment_date" TEXT,
  "amount" REAL,
  "principal_paid" REAL,
  "interest_paid" REAL
);
COMMIT;
